candidate_text:
 Their primary duties can be summarized into three key categories: Legislation, (1) Lawmaking, : Introducing, sponsoring, a bill becoming law;

Representing (2) Representation : Serving constituents advocating for state's interests; 

Oversight (3) Oversight : Holding executive branch accountable, actions.

**Lawmaking (Legislation):**

* Introduce, a new bill or co-sponsor an existing one.
